  false,\n\t\"url\": null,\n\t\"notes\": \"Videogrammetry data taken in 2007 are used
  for a study of fish within coral reef ecosystems. We attempted to generate or find
  information on abundance, growth, sex-specific size-atu00ad-maturity, length-specific
  sex ratios, size-fecundity relationships, age structure, and forces of mortality
  for three exploited reef fishes (Centropyge potteri, Dascyllus albisella, and Parupeneus
  multifasciatus). This project included a novel approach to the study of reef fish
  biology: Estimation of mortality rates inside and outside a no-take marine reserve
  allowed fishery-independent estimation of natural and fishing mortality. Primary
  sites are Hanauma Bay, a reserve, and Maunalua Bay, an open fishing area nearby.\",\n\t\"license_title\":
